  selector: 'app-game-icon',
  templateUrl: './game-icon.component.html',
  styleUrls: ['./game-icon.component.scss']
})
export class GameIconComponent {
  @Input() iconType: string = '';
}
<button class="icon-option-container btn-icons paper-icon" (click)="selectedOption(iconType)"></button>
